download()
{
  
  const downloadLink = document.createElement("a");
  console.log("download clicked",this.inquirydat[this.p-1]);
  const fileName = (this.p-1)+"-invoice.pdf";
  downloadLink.href = `data:application/pdf;base64,${this.inquirydat[this.p-1]}`;
  downloadLink.download = fileName;
  downloadLink.click(); 
}
